import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonButton, IonCol, IonRow, IonImg } from '@ionic/react';
import React from 'react';
import './Home.css';
import { homedir } from 'os';

const Home: React.FC = () => {
  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonTitle>Coffee DB</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent>
        <IonHeader collapse="condense">
          <IonToolbar>
            <IonTitle size="large">Blank</IonTitle>
          </IonToolbar>
        </IonHeader>
      </IonContent>
      <IonContent>
        <IonImg src='../../../assets/img/coffee-machine.png'/>
      </IonContent>
    </IonPage>
  )
}

export default Home
